import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";


let state ={
  postData:[
    { message: "hi", id: 1, likes: "15" },
    { message: "how is your name", id: 1, likes: "15" },
    { message: "what are you doing", id: 1, likes: "15" },
  ],
  dialogsData:[
    { id: 1, name: "Eugene" },
    { id: 2, name: "Sasha" },
    { id: 3, name: "Igor" },
    { id: 4, name: "lex" },
    { id: 5, name: "Ilya" },
  ],
  messageData:[
    { say: "hi", id: 1 },
    { say: "how is your name", id: 2 },
    { say: "what are you doing", id: 3 },
  ]
}



ReactDOM.render(
  <React.StrictMode>
    <App postData={state.postData} dialogsData={state.dialogsData} messageData={state.messageData}/>
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
